import React from "react";
import { HeaderLog } from "../../LoginComponent/HeaderLog";
import styles from './SignIn.module.css'


const SignIn = () => {
    return (
        <div className={styles.signin}>
            <HeaderLog/>
        </div>
    );
}

export default SignIn;
